// https://leetcode.com/problems/count-number-of-homogenous-substrings/description/

package main

import "fmt"

func main() {
	// s := "abbcccaa"
	s := ""
	fmt.Println(countHomogenous(s))
}

func countHomogenous(s string) int {
	total := 0
	count := 0
	prev := rune(s[0])
	for _, curr := range s {
		if prev == curr {
			count++
		} else {
			// sum of subsets looks like gauss summation, sum(x)1, x
			sum := (count * (count + 1)) / 2
			total += sum
			count = 1
			prev = curr
		}
	}

	sum := (count * (count + 1)) / 2
	total += sum
	return total % (int(1e9) + 7)
}

